# -*- coding: utf-8 -*-
# Above necessary for python2 (not needed for python3).
"""
.. module:: JCluster
   :synopsis: J-factor for dark matter annihilation in galaxy cluster subhalos.

.. moduleauthor:: Chris Savage <chris@savage.name>

This module performs various J-factor calculations for dark matter
annihilation in galaxy cluster subhalos.

The J-factor uses the parametrization given in Eqns. 8 & 9 of
`Han et al., MNRAS 427, 1651 (2012) <http://dx.doi.org/10.1111/j.1365-2966.2012.22080.x>`_
`[arXiv:1207.6749] <http://arxiv.org/abs/1207.6749>`_:

.. math::
  J(r) &= \\frac{J_0}{1+\\frac{16r^2}{r_{200}^2}}  & \\qquad r<r_{200} \\\\
       &= \\frac{J_0}{17} e^{-\\alpha (r-r_{200})} & \\qquad r>r_{200}

where :math:`\\alpha = \\frac{2.377}{r_{200}}` and :math:`J_0` is the
J-factor at the center.  This J-factor is optionally convolved with a
gaussian point spread function (PSF) with variance :math:`\\sigma^2`:

.. math::
  PSF(\\mathbf{r}'|\\mathbf{r})
       = \\frac{1}{2\\pi\\sigma^2}
         e^{-(\\mathbf{r}'-\\mathbf{r})^2/2\\sigma^2}

..

  `Chris Savage <mailto:chris@savage.name>`_,
  `Nordita <http://www.nordita.org>`_
  (2015)

|

"""

