# J FACTOR FUNCTION (PUBLIC) ===========================================

def LogJCluster(r, r200=None, sigma=None, J0=None, IJ=None):
    """
    Logarithm of the cluster J factor at the given radius.

    At least one of the size parameters r200 or sigma must be given
    and one of the normalization parameters J0 or IJ must be given.
    All arguments must use a consistent set of units, either radians
    or degrees.

    :param r:     The radial distance at which to calculate the J factor.
    :param r200:  The virial radius for the cluster, defined as the
                  radius at which the average density is 200 times
                  the critical density.  If not given, a point source
                  is assumed.
    :param sigma: The standard deviation of the Gaussian PSF.
                  If not given, perfect resolution is assumed.
    :param J0:    The J factor at r=0, prior to application of the
                  PSF.  Cannot be used if the cluster is a point
                  source (r200=0) as J(0) is infinite; use IJ instead.
    :param IJ:    The total integrated J-factor (i.e. integrated over
                  [0,âˆž)).
    :returns:     The logarithm of the J-factor at r.
                  J is set to 0 for invalid parameters.
    :rtype:       float
    """
    
    # Value to return for invalid parameters
    BAD_LOGJ = -_FLOAT_INFO.max
    
    # Determine scaling
    if (r200 == None) or (r200 < 0):
      r200 = 0.0
    if (sigma == None) or (sigma < 0):
      sigma = 0.0
    d = 1.0*(r200+sigma)  # Ensure float
    if (d <= 0.0):
      return BAD_LOGJ
    u = r200/d
    x = max(r,0.0)/d
    
    # Determine normalization
    # ln(17)/16 + 2(1+2.377)/2.377^2 = 0.247392
    if (IJ != None):
      # For point sources (u=0), J(0) is ill-defined.
      # We set J0 to the _post_ PSF J-factor at r=0 instead.
      if (u == 0.0):
        J0 = IJ / (2*_PI*sigma**2)
      else:
        J0 = IJ / (0.2474*_PI*r200**2)
      pass
    elif (J0 != None):
      IJ = 0.2474*_PI*r200**2*J0
    else:
      J0 = 0.0
      IJ = 0.0
    if (IJ <= 0.0):
      return BAD_LOGJ
    
    # Special cases:
    # Do explicit calculations for point sources or
    # perfect instrument resolution
    if (u == 0.0):    # Point source (r200=0)
      # J(r) = J(0) e^(-r^2/2Ïƒ^2)
      return log(J0) - 0.5*x**2
    elif (u == 1.0):  # Perfect resolution (sigma=0)
      # J(r) = J0 / (1+r^2/(r200/4)^2)     if r < r200
      #      = J0/17 e^(-2.377(r/r200-1))  otherwise
      if (x <= 1.0):
        return log(J0/(1+16*x**2))
      else:
        return log(J0/17) - 2.377*(x-1)
    
    # Interpolation only goes up to x=100.
    # Beyond this, J factor is tiny, so we just set it to zero.
    if (x > 100.0):
      return -_FLOAT_INFO.max
    
    # Use interpolation:
    # J(0|u) in units of IJ/Ï€d^2
    Jnorm = _J0interpF(u) * IJ/(_PI*d**2)
    # _JinterpF(x=r/d,u) is Log[J(r)/J(0)]
    return log(Jnorm) + _JinterpF(x,u)[0,0]


def JCluster(r, r200=None, sigma=None, J0=None, IJ=None):
    """
    The cluster J factor at the given radius.

    See :func:`~JCluster.LogJCluster` for a description of the arguments.
    """
    return exp(LogJCluster(r,r200,sigma,J0,IJ))


