# INTEGRATED J FACTOR FUNCTION (PUBLIC) ================================

def LogIJCluster2(R=None, r200=None, sigma=None, J0=None, IJ=None):
    """
    The logarithm of the integrated cluster J factor, integrated over
    both [0,R] and [R,âˆž).

    At least one of the size parameters r200 or sigma must be given.
    All arguments must use a consistent set of units, either radians
    or degrees.

    Either of the parameters J0 or IJ may be specified to set the
    normalization; if neither is given, the log of the fractions of
    the total integrated J-factor in the two regions are returned.
    
    :param R:     The radial distance at which to integrate to/from.
                  If not given, the total integrated J factor is
                  calculated *twice*, i.e. the two integrations are
                  over [0,âˆž) and [0,âˆž).
    :param r200:  The virial radius for the cluster, defined as the
                  radius at which the average density is 200 times
                  the critical density.  If not given, a point source
                  is assumed.
    :param sigma: The standard deviation of the Gaussian PSF.
                  If not given, perfect resolution is assumed.
    :param J0:    The J factor at r=0, prior to application of the
                  PSF.  Cannot be used if the cluster is a point
                  source (r200=0) as J(0) is infinite; use IJ instead.
    :param IJ:    The total integrated J-factor (i.e. integrated over
                  [0,âˆž)).
    :returns:     The logarithms of the J-factor integrated over
                  [0,R] and [R,âˆž).  The integrals are set to 0 for
                  invalid parameters.
    :rtype:       2-tuple float
    """
    
    # Value to return for invalid parameters
    BAD_LOGIJ = (-_FLOAT_INFO.max,-_FLOAT_INFO.max)
    
    # Determine scaling
    if (r200 == None) or (r200 < 0):
      r200 = 0.0
    if (sigma == None) or (sigma < 0):
      sigma = 0.0
    d = 1.0*(r200+sigma)  # Ensure float
    if (d <= 0.0):
      return BAD_LOGIJ
    u = r200/d
    
    # Determine normalization
    # ln(17)/16 + 2(1+2.377)/2.377^2 = 0.247392
    if (IJ != None):
      pass
    elif (J0 != None):
      IJ = 0.2474 * _PI*r200**2*J0
    else:
      IJ = 1.0
    if (IJ <= 0.0):
      return BAD_LOGIJ
    logIJ = log(IJ)
    
    # Special case: no R given
    # Set both integrals to total integrated J factor, useful
    # for convenience routines that make use of this routine.
    if (R == None):
      return (logIJ,logIJ)
    
    # Scaled boundary of integration
    X = max(R,0.0)/d
    
    # Special case: point source (r200=0)
    # IJ(r>R) = IJ e^(-R^2/2Ïƒ^2)
    if (u == 0.0):
      logf  = -0.5*X**2
      if (logf < -_FLOAT_INFO.epsilon):
        log1f = log1p(-exp(-0.5*X**2))
      else:
        log1f = -_FLOAT_INFO.max
      return (logIJ+log1f,logIJ+logf)
    
    # Interpolation only goes up to X=31.6.
    # Beyond this, integrated J factor is tiny, so we just
    # set it to zero.
    if (X > 31.6):
      return (logIJ,-_FLOAT_INFO.max)
    
    # Use interpolation:
    # _IJinterpF(X=R/d,u) is Log[IJ(r>R)/J(0)]
    logf = _JinterpF(X,u)[0,0]
    if (logf < -_FLOAT_INFO.epsilon):
      log1f = log1p(-exp(logf))
    else:
      log1f = -_FLOAT_INFO.max
    return (logIJ+log1f,logIJ+logf)


def LogIJCluster(R=None, r200=None, sigma=None, J0=None, IJ=None):
    """
    Logarithm of the J factor integrated from 0 to R.

    If R is not given, the integration is performed over [0,âˆž),
    i.e. the total integrated J factor is calculated.

    See :func:`~JCluster.LogIJCluster2` for a description of the arguments.
    """
    return LogIJCluster2(R,r200,sigma,J0,IJ)[0]


def LogIJClusterC(R=None, r200=None, sigma=None, J0=None, IJ=None):
    """
    Logarithm of the J factor integrated from R to infinity.

    If R is not given, the integration is performed over [0,âˆž),
    i.e. the total integrated J factor is calculated.

    See :func:`~JCluster.LogIJCluster2` for a description of the arguments.
    """
    return LogIJCluster2(R,r200,sigma,J0,IJ)[-1]


def IJCluster(R=None, r200=None, sigma=None, J0=None, IJ=None):
    """
    J factor integrated from 0 to R.

    If R is not given, the integration is performed over [0,âˆž),
    i.e. the total integrated J factor is calculated.

    See :func:`~JCluster.LogIJCluster2` for a description of the arguments.
    """
    return exp(LogIJCluster2(R,r200,sigma,J0,IJ)[0])


def IJClusterC(R=None, r200=None, sigma=None, J0=None, IJ=None):
    """
    J factor integrated from R to infinity.

    If R is not given, the integration is performed over [0,âˆž),
    i.e. the total integrated J factor is calculated.

    See :func:`~JCluster.LogIJCluster2` for a description of the arguments.
    """
    return exp(LogIJCluster2(R,r200,sigma,J0,IJ)[-1])


