# INTEGRATED J FACTOR COVERAGE RADIUS FUNCTION (PUBLIC) ================

def JClusterRadius(r200=None, sigma=None, cl=None, p=None, clsigma=None):
    """
    The radius from the cluster center that contains the specified
    fraction of signal.

    At least one of the size parameters r200 or sigma must be given.
    If both are given, they must use a consistent set of units, either
    radians or degrees.  The returned radius is in the same units.

    The coverage level can be specified explicitly with cl, via its
    complement p=1-cl, or via the equivalent coverage within the given
    number of deviations clsigma in a normal distribution.  For example,
    cl=0.9545, p=0.0455, and clsigma=2.0 given the same result (the
    radius with 95% or 2-sigma coverage).  If none of these are given,
    1-sigma coverage is assumed.

    :param r200:    The virial radius for the cluster, defined as the
                    radius at which the average density is 200 times
                    the critical density.  If not given, a point source
                    is assumed.
    :param sigma:   The standard deviation of the Gaussian PSF.
                    If not given, perfect resolution is assumed.
    :param cl:      The coverage level, or fraction of the total signal
                    the radius should contain.
    :param p:       The complement of the coverage level, 1-cl.
                    Can be used to avoid numerical issues with coverage
                    levels near unity.
    :param clsigma: The coverage level in terms of equivalent number of
                    deviations in a normal distribution.  That is, the
                    fraction of the standard normal distribution lying
                    between -clsigma and +clsigma.
    :returns:       The radius containing the desired fraction of the
                    cluster signal.  In the same units as r200 and/or
                    sigma.  Set to a large number for invalid parameters.
    :rtype:         float
    """
    
    # Value to return for invalid parameters
    BAD_R = _FLOAT_INFO.max
    
    # Determine scaling
    if (r200 == None) or (r200 < 0):
      r200 = 0.0
    if (sigma == None) or (sigma < 0):
      sigma = 0.0
    d = 1.0*(r200+sigma)  # Ensure float
    if (d <= 0.0):
      return BAD_R
    u = r200/d
    
    # Determine coverage level
    if (clsigma != None):
      nsigma = clsigma
    elif (p != None):
      if (p <= 0.0) or (p > 1.0):
        return BAD_R
      nsigma = 2**0.5*erfcinv(p)
    elif (cl != None):
      if (cl < 0.0) or (cl >= 1.0):
        return BAD_R
      nsigma = 2**0.5*erfinv(cl)
    else:
      nsigma = 1.0
    
    # Interpolation only goes up to nsigma=5.0, but we
    # are probably OK to use extrapolation to much higher
    # coverage sigma.
    # Beyond this, integrated J factor is tiny, so we just
    # set it to zero.
    if (nsigma > 1e99):
      return _FLOAT_INFO.max
    
    # Use interpolation:
    # _IJCLinterpF(nsigma,u) is radius with given coverage
    return d*_IJCLinterpF(nsigma,u)[0,0]


